vector<vector<int>> solve(vector<int> nums)
{
    set<vector<int>> alreadyfin;
    if (nums.size() < 3)
    {
        return {};
    }
    sort(nums.begin(), nums.end());
    for (int i = 0; i < nums.size() - 2; i++)
    {
        int j = i + 1;
        int k = nums.size() - 1;
        
        while (j < k)
        {
            int sum = nums[i] + nums[j] + nums[k];
            if (sum == 0)
            {
                alreadyfin.insert({nums[i],nums[j++],nums[k--]});
            }
            else if (sum > 0)
            {
                k--;
            }
            else
            {
                //sum<0
                j++;
            }
        }
    }
    vector<vector<int>> finalans(alreadyfin.begin(),alreadyfin.end());
    for (int i = 0; i < finalans.size(); i++)
    {
        for (int j = 0; j < finalans[i].size(); j++)
        {
            cout << finalans[i][j] << " ";
        }
        cout << endl;
    }
    return finalans;
}

